        private void AddDrivers()
        {
            this.driversToolStripMenuItem.DropDownItems.Clear();
            this.removeDriverToolStripMenuItem.DropDownItems.Clear();
            this.editDriverToolStripMenuItem.DropDownItems.Clear();
            if (_numDrivers == 0)
            {
                return;
            }
            namesToolStripMenuItem = new System.Windows.Forms.ToolStripMenuItem[_numDrivers];
            removeNamesToolStripMenuItem = new System.Windows.Forms.ToolStripMenuItem[_numDrivers];
            editNamesToolStripMenuItem = new System.Windows.Forms.ToolStripMenuItem[_numDrivers];
            int i = 0;
            foreach (string s in _driverList.Split('|'))
            {
                if (s != "")
                {
                    this.namesToolStripMenuItem[i] = new System.Windows.Forms.ToolStripMenuItem();
                    this.namesToolStripMenuItem[i].Name = "driverName" + i.ToString() + "MenuItem";
                    this.namesToolStripMenuItem[i].Size = new System.Drawing.Size(152, 22);
                    this.namesToolStripMenuItem[i].Text = s;
                    this.namesToolStripMenuItem[i].Click += new System.EventHandler(Names_Click);
                    this.removeNamesToolStripMenuItem[i] = new System.Windows.Forms.ToolStripMenuItem();
                    this.removeNamesToolStripMenuItem[i].Name = "removeDriverName" + i.ToString() + "MenuItem";
